import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Navbar from './Navbar';

function GlobalRouter() {
  return (
    <div>
      <Router>
        <Navbar />
      </Router>
    </div>
  );
}

export default GlobalRouter;
